import React, {Component} from 'react';
import {Card, Button} from 'react-bootstrap';
import {Timeline, TimelineEvent} from 'react-event-timeline';
import Comments from './comments';

class PostItems extends Component {
    render(){
        const delete_btn={
            float: "rigtht"
        }
        let posts = this.props.entries.map((post)=>{
            return <Timeline key={post.id}>
                            <TimelineEvent createdAt={Date(post.createdAt)}>
                                {post.content}
                              <Button stype={delete_btn} onClick={this.props.superDelete.bind(null, post.id)}>삭제하기</Button> 
                            </TimelineEvent>
                    </Timeline>
            
                    {/* <div key={post.id} */} /* onClick={this.props.superDelete.bind(null, post.id)}>/*}
